&lt;p&gt;&lt;strong&gt;Descripci&oacute;n:&nbsp;&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;&iexcl;Este set de introducci&oacute;n es fant&aacute;stico para que los m&aacute;s peque&ntilde;os de la casa d&eacute;n sus primeros pasos en el mundo LEGO&reg; DUPLO&reg; de la construcci&oacute;n y la reconstrucci&oacute;n! La Caja Rosa de Diversi&oacute;n &ldquo;Todo en Uno&rdquo; contiene elementos especiales, como ventanas, un simp&aacute;tico conejito, una gallina y ladrillos numerados para ayudar a tu joven constructora a aprender a contar. Incluye tambi&eacute;n ladrillos DUPLO cl&aacute;sicos, por lo que la experiencia de construcci&oacute;n evolucionar&aacute; y cambiar&aacute; cada vez que juegue tu hija. Todo viene enuna resistente y atractiva caja de almacenamiento con forma de ladrillo LEGO rosa. Incluye una figura DUPLO de una chica.&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Tema: Duplo&lt;/li&gt;
&lt;li&gt;Incluye una figura LEGO&reg; DUPLO&reg; de una chica.&lt;/li&gt;
&lt;li&gt;Incluye tambi&eacute;n un conejito, una gallina, ladrillos decorados con n&uacute;meros y otros para emparejarlos, as&iacute; como ladrillos DUPLO surtidos.&lt;/li&gt;
&lt;li&gt;Empareja los ladrillos numerados con los ladrillos decorados del mismo color.&lt;/li&gt;
&lt;li&gt;La caja con forma de ladrillo LEGO es una soluci&oacute;n de almacenamiento fant&aacute;stica y muy llamativa.&lt;/li&gt;
&lt;li&gt;Los productos LEGO&reg; DUPLO&reg; son divertidos y seguros para los m&aacute;s peque&ntilde;os.&lt;/li&gt;
&lt;li&gt;La casa mide m&aacute;s de 14 cm de altura, 9 cm de anchoy 3 cm de profundidad.&lt;/li&gt;
&lt;li&gt;El conejito mide m&aacute;s de 4 cm de altura.&lt;/li&gt;
&lt;li&gt;La chica mide m&aacute;s de 5 cm de altura.&lt;/li&gt;
&lt;li&gt;Edad: 1&frac12; - 5&lt;/li&gt;
&lt;li&gt;Piezas: 65&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;&nbsp;&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;T&eacute;rminos y condiciones:&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;* Tienda Oficial de LEGO&reg;.&lt;/p&gt;
&lt;p&gt;* Garant&iacute;a: Sujetas a la marca.&lt;/p&gt;
&lt;p&gt;* Tiempo de entrega: De 6 a 10 d&iacute;as habiles a partir de la aprobaci&oacute;n del pago.&lt;/p&gt;
&lt;p&gt;* Valido hasta agotar existencias.&lt;/p&gt;
&lt;p&gt;* Unidades limitadas.&lt;/p&gt;
&lt;p&gt;* Precios sujetos a cambios sin previo aviso.&lt;/p&gt;

